export default function validationE(userData, setErrors, errors) {
    if (!userData.password){
        setErrors({...errors, password: 'Ingrese una contraseña'})
    } else if (!/\d+/.test(userData.password)) {
      setErrors({...errors, password: 'La contraseña debe tener al menos un numero'});
    } else if (userData.password.length < 6 || userData.password.length > 10) {
      setErrors({...errors, password: 'la contraseña tiene que tener una longitud entre 6 y 10 caracteres'})
    } else setErrors({...errors, password:''})
}
